  \"Mercury concentrations in largemouth bass and other fishes of the Loxahatchee
  National Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 42,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:09.769934\",\n\t\"name\": \"mercury-concentrations-in-largemouth-bass-and-other-fishes-of-the-loxahatchee-national-wil\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"From September 17-21, 1990, 32 largemouth
  bass (Micropterus salmoides) and three other fish species were collected from eight
  locations at the Loxahatchee National Wildlife Refuge (NWR), Palm Beach County,
  Florida. The fish were collected for mercury analysis of muscle tissue. Ninety-one
  percent of the largemouth bass (n = 29) had mercury levels that exceeded the Florida
  limited-consumption concentration of O. 5 parts per million (ppm), wet weight. Nine
  percent (n=3) exceeded Florida's no-consumption concentration of 1.5 ppm. Two other
  species: Florida gar (Lepisosteus platyrhincus) and bowfin (Amia calva) also had
  elevated levels of mercury. One brown bullhead (lctalurus nebulosus) had a mercury
  concentration below any level of concern. Evaluation of weight, length and age of
  largemouth bass did not provide mechanisms by which recreational fishermen could
  selectively retain individual fish that are low in mercury. All locations that were
  sampled appear to provide environments conducive for accumulation of mercury in
  largemouth bass and other fish species. Several fish and wildlife trust resource
  species may be at some risk when utilizing these areas. Additional geographic and
  biotic environmental contaminant work is recommended.\",\n\t\"license_title\": \"License
